import React from "react";

const AttendeeTable = (props) => {
  console.log(props.attendee)(
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Username</th>
          <th>Sex</th>
          <th>Year Of Birth</th>
          <th>University</th>
          <th>Major</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {props.attendees.length > 0 ? (
          props.attendees.map((attendee) => (
            <tr key={attendee.username}>
              <td>{attendee.name}</td>
              <td>{attendee.username}</td>
              <td>{attendee.sex}</td>
              <td>{attendee.yearOfBirth}</td>
              <td>{attendee.University}</td>
              <td>{attendee.Major}</td>
              <td>
                <button
                  onClick={() => {
                    props.editRow(attendee);
                  }}
                  className="button muted-button"
                >
                  Edit
                </button>
                <button
                  onClick={() => props.deleteUser(attendee.username)}
                  className="button muted-button"
                >
                  Delete
                </button>
              </td>
            </tr>
          ))
        ) : (
          <tr>
            <td colSpan={3}>No users</td>
          </tr>
        )}
      </tbody>
    </table>
  );
};

export default AttendeeTable;
